import * as React from 'react';
import './banner.css';
import HomeBanner from '../img/home_banner.png';

export class Banner extends React.Component{
    render() {
        return (
            <div>
               <img src={HomeBanner} alt="home_banner"/>
            </div>
        )
    }
}
